import React, {useEffect, useState} from 'react';



function Register(){
    useEffect(()=>{
        fetchUsersTable();
    }, []);

    //define the states
    const [users, setUsers] = useState([]);
    const [show, setShow] = useState(true);

    //call the api to retrieve the data
    const fetchUsersTable = async () => {
        const data = await fetch(
            'http://localhost:5000/api/users', {
            method: 'get'
            }
        );
        const jsonData = await data.json();
        setUsers(jsonData);
        console.log(users);
        console.log("ran fetch");
    }

    //Make a register form
    return(
        <div>

            <h1>Register for Trading Practice</h1>
            <form>
            <div className="form-group">
                <label for="exampleInputEmail1">User Name</label>
                <input type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
                <small id="emailHelp" className="form-text text-muted">Must be a unique user name</small>
            </div>
            <div className="form-group">
                <label for="exampleInputPassword1">Password</label>
                <input type="password" className="form-control" id="exampleInputPassword1"/>
            </div>
            <div className="form-group form-check">
                <input type="checkbox" className="form-check-input" id="exampleCheck1"/>
                <label className="form-check-label" for="exampleCheck1">Check me out</label>
            </div>
            <button type="submit" className="btn btn-primary">Submit</button>
            </form>

            
        </div>
    );
    


}

export default Register;
